-- BANCO DE DADOS DE UMA LIVRARIA -> db_livraria_fechamento_bezzos
DROP DATABASE IF EXISTS db_livraria_bezzos;

CREATE DATABASE IF NOT EXISTS db_livraria_bezzos;

USE db_livraria_bezzos;

-- TABELAS DO db_livraria_fechamento_bezzos:

-- 1) TABELA DE CARGOS PARA OS FUNCIONÁRIOS
CREATE TABLE IF NOT EXISTS tb_cargos_fnc(
	fnc_cargos INT(1) AUTO_INCREMENT,
    fnc_nome_cargo VARCHAR(30) NOT NULL,
    fnc_departamento VARCHAR(10) NOT NULL,
	fnc_salario VARCHAR(12) NOT NULL,
    fnc_jornada VARCHAR (20) NOT NULL,
    fnc_data_contratacao VARCHAR(10) NOT NULL,
    PRIMARY KEY (fnc_cargos)
);

-- 1.1) FUNCIONÁRIOS

CREATE TABLE IF NOT EXISTS tb_funcionario(
	fnc_matricula INT(2) AUTO_INCREMENT,
	fnc_nome VARCHAR(45) NOT NULL,
    fnc_sobrenome VARCHAR(50) NOT NULL,
    fnc_rg VARCHAR (13) NOT NULL UNIQUE,
    fnc_cpf VARCHAR(15) NOT NULL UNIQUE,
    fnc_cidade VARCHAR(25) NOT NULL,
    fnc_bairro VARCHAR(30) NOT NULL,
    fnc_complemento VARCHAR(30),
    fnc_logradouro VARCHAR(30) NOT NULL,
    fnc_numero VARCHAR(10) NOT NULL,
    fnc_cargos INT(1) NOT NULL,
    PRIMARY KEY (fnc_matricula),
    CONSTRAINT FK_tb_funcinario_tb_cargos_fnc FOREIGN KEY (fnc_cargos) 
		REFERENCES tb_cargos_fnc(fnc_cargos)
    );

-- 1.2) TABELA DE CONTATO DOS FUNCIONÁRIOS

CREATE TABLE IF NOT EXISTS tb_contato_fnc(
	cont_funcionario INT(4) AUTO_INCREMENT,
    contfnc_tel_contato VARCHAR(14) NOT NULL,
    contfnc_email VARCHAR(30) UNIQUE NOT NULL,
    contfnc_tel_celular VARCHAR(14),
    contfnc_tel_fixo VARCHAR(14),
    contfnc_comercial VARCHAR(14),
    fnc_matricula INT(2) NOT NULL,
    PRIMARY KEY (cont_funcionario),
    CONSTRAINT FK_tb_funcinario_tb_contato_fnc FOREIGN KEY (fnc_matricula) 
		REFERENCES tb_funcionario(fnc_matricula)
	);


-- 2) TABELA DOS LIVROS QUE A GRANDE LIVRARIA FECHAMENTO OFERECE AO SEU PÚBLICO!

CREATE TABLE IF NOT EXISTS tb_livro(
	cod_lvr INT(6) AUTO_INCREMENT,
    lvr_titulo VARCHAR(40) NOT NULL,
    lvr_autor_sobrome VARCHAR(35) NOT NULL,
    lvr_autor_nome VARCHAR(20) NOT NULL,
    lvr_edicao VARCHAR(3) NOT NULL,
    lvr_ano VARCHAR(4) NOT NULL,
    lvr_isbn VARCHAR(17) NOT NULL UNIQUE,
    lvr_assunto VARCHAR(20) NOT NULL,
    lvr_paginas INT(3) NOT NULL,
    lvr_genero VARCHAR(15) NOT NULL,
    lvr_preco VARCHAR(10) NOT NULL,
    lvr_quantidade VARCHAR(5) NOT NULL,
    PRIMARY KEY (cod_lvr)
    );

-- 3) TABELA DAS EDITORAS QUE IRÃO FORNECER OS LIVROS PARA A LIVARIA

CREATE TABLE IF NOT EXISTS tb_editora(
	id_editora INT(3) AUTO_INCREMENT,
    ed_nome_fantasia VARCHAR(45) NOT NULL,
    ed_razao_social VARCHAR(50) UNIQUE NOT NULL,
    ed_cnpj VARCHAR(13) NOT NULL UNIQUE,
	ed_cidade VARCHAR(25) NOT NULL,
    ed_logradouro VARCHAR(30) NOT NULL,
    ed_bairro VARCHAR(30) NOT NULL,
    ed_numero VARCHAR(10) NOT NULL,
    ed_complemento VARCHAR(30),
    ed_cep VARCHAR(10) NOT NULL,
    PRIMARY KEY (id_editora)
);

-- 3.1) TABELA DE CONTATOS DAS EDITORAS

CREATE TABLE IF NOT EXISTS tb_contato_editora(
	id_contato_ed INT(4) AUTO_INCREMENT,
    ed_tel_contato VARCHAR(14) NOT NULL,
    ed_email VARCHAR(30) NOT NULL UNIQUE,
    ed_tel_celular VARCHAR(14),
    ed_tel_fixo VARCHAR(14),
    ed_comercial VARCHAR(14),
    id_editora INT(3) NOT NULL,
    PRIMARY KEY (id_contato_ed),
    CONSTRAINT FK_tb_editora_tb_contato_editora FOREIGN KEY (id_editora) 
		REFERENCES tb_editora(id_editora)
	);

-- 4) TABELA DOS CLIENTES

CREATE TABLE IF NOT EXISTS tb_cliente(
	id_cliente INT(5) AUTO_INCREMENT,
    cl_nome VARCHAR(45) NOT NULL,
    cl_sobrenome VARCHAR(50) NOT NULL,
    cl_cpf VARCHAR(15) NOT NULL UNIQUE,
	cl_rg VARCHAR (13) NOT NULL UNIQUE,
    cl_cidade VARCHAR(25) NOT NULL,
    cl_logradouro VARCHAR(30) NOT NULL,
    cl_bairro VARCHAR(30) NOT NULL,
    cl_numero VARCHAR(10) NOT NULL,
    cl_complemento VARCHAR(30),
    cl_cep VARCHAR(10) NOT NULL,
    PRIMARY KEY (id_cliente)
);

-- 4.1) TABELA DE CONTATO DOS CLIENTES

CREATE TABLE IF NOT EXISTS tb_contato_cliente(
	id_contato_cl INT(4) AUTO_INCREMENT,
    cl_tel_contato VARCHAR(14) NOT NULL,
    cl_email VARCHAR(30) NOT NULL UNIQUE,
    cl_tel_celular VARCHAR(14),
    cl_tel_fixo VARCHAR(14),
    cl_comercial VARCHAR(14),
    id_cliente INT(5) NOT NULL,
    PRIMARY KEY (id_contato_cl),
    CONSTRAINT FK_tb_cliente_tb_contato_cliente FOREIGN KEY (id_cliente) 
		REFERENCES tb_cliente(id_cliente)
	);
    
-- 5) TABELA DE COMPRA

CREATE TABLE IF NOT EXISTS tb_compra(
	id_compra INT(3) AUTO_INCREMENT,
    cmpr_valor FLOAT(5,2) NOT NULL,
    cmpr_data DATE NOT NULL,
    cod_lvr INT(6) NOT NULL,
    id_cliente INT(5) NOT NULL,
    PRIMARY KEY (id_compra),
    CONSTRAINT FK_tb_livro_tb_compra FOREIGN KEY (cod_lvr) 
    REFERENCES tb_livro(cod_lvr),
    CONSTRAINT FK_tb_cliente_tb_compra FOREIGN KEY (id_cliente) 
    REFERENCES tb_cliente(id_cliente)    
);

-- 6) TABELA DE FORNECIMENTO DO LIVRO

CREATE TABLE IF NOT EXISTS tb_fornecimento(
	id_fornece INT(3) AUTO_INCREMENT,
    fornec_qtd VARCHAR(4) NOT NULL,
    fornec_data DATE NOT NULL,
    id_editora INT(3) NOT NULL,
    cod_lvr INT(6) NOT NULL,
    PRIMARY KEY(id_fornece),
    CONSTRAINT FK_tb_editora_tb_fornecimento FOREIGN KEY (id_editora) 
    REFERENCES tb_editora(id_editora),
    CONSTRAINT FK_tb_livro_tb_fornecimento FOREIGN KEY (cod_lvr) 
    REFERENCES tb_livro(cod_lvr) 
    );
    
-- 7) TABELA DE VENDA DO LIVRO PELO FUNCIONÁRIO PARA O CLIENTE

CREATE TABLE IF NOT EXISTS tb_venda(
	id_venda INT(3) AUTO_INCREMENT,
	id_compra INT(3) NOT NULL,
    fnc_matricula INT(2) NOT NULL,
    id_cliente INT(5) NOT NULL,
    PRIMARY KEY (id_venda),
    CONSTRAINT FK_tb_funcionario_tb_venda FOREIGN KEY (fnc_matricula) 
    REFERENCES tb_funcionario(fnc_matricula),
    CONSTRAINT FK_tb_cliente_tb_venda FOREIGN KEY (id_cliente) 
    REFERENCES tb_cliente(id_cliente),
    CONSTRAINT FK_tb_compra_tb_venda FOREIGN KEY (id_compra) 
    REFERENCES tb_compra(id_compra) 
);

