SELECT * FROM tb_contato_fnc;

-- Liga funcionarios aos cargos
SELECT a.fnc_nome_cargo, a.fnc_departamento, b.fnc_nome, b.fnc_sobrenome, b.fnc_cpf, b.fnc_matricula FROM tb_cargos_fnc AS a INNER JOIN tb_funcionario AS b ON a.fnc_cargos = b.fnc_cargos;

-- Filtrar cargo especifico
SELECT a.fnc_nome_cargo, a.fnc_departamento, b.fnc_nome, b.fnc_sobrenome, b.fnc_cpf FROM tb_cargos_fnc AS a INNER JOIN tb_funcionario AS b ON a.fnc_cargos = b.fnc_cargos WHERE a.fnc_nome_cargo = '#';

-- Liga funcionarios aos contatos
SELECT a.fnc_matricula, a.fnc_nome, a.fnc_sobrenome, a.fnc_cpf, b.contfnc_tel_contato, b.contfnc_email FROM tb_funcionario AS a INNER JOIN tb_contato_fnc AS b ON a.fnc_matricula = b.fnc_matricula;

