SELECT * FROM tb_contato_editora;

-- Liga contato da editora a editora
SELECT a.id_editora, a.ed_nome_fantasia, a.ed_razao_social, a.ed_cnpj, b.ed_tel_contato, b.ed_email FROM tb_editora AS a INNER JOIN tb_contato_editora AS b ON a.id_editora = b.id_editora;


SELECT * FROM tb_cliente;


SELECT * FROM tb_contato_cliente;

-- Liga contato dos clientes aos clientes
SELECT a.id_cliente, a.cl_nome, a.cl_sobrenome, a.cl_cpf, b.cl_tel_contato, b.cl_email FROM tb_cliente AS a INNER JOIN tb_contato_cliente AS b ON a.id_cliente = b.id_cliente;


SELECT * FROM tb_compra;

-- Identifica para quem vendeu e qual o produto
SELECT a.id_compra, a.cmpr_valor, a.cmpr_data, b.lvr_titulo, b.lvr_isbn, c.cl_nome, cl_sobrenome, c.cl_cpf FROM tb_compra AS a INNER JOIN tb_livro AS b ON a.cod_lvr = b.cod_lvr INNER JOIN tb_cliente AS c ON a.id_cliente = c.id_cliente;



SELECT * FROM tb_fornecimento;

-- Liga quem forneceu ao forncedor
SELECT a.id_fornece, a.fornec_qtd, b.ed_nome_fantasia, b.ed_razao_social, b.ed_cnpj, c.lvr_titulo, c.lvr_isbn FROM tb_fornecimento AS a INNER JOIN tb_editora AS b ON a.id_editora = b.id_editora INNER JOIN tb_livro AS c ON a.cod_lvr = c.cod_lvr;


SELECT * FROM tb_venda;

-- Liga quem vendeu com quem comprou
SELECT a.id_venda, b.cmpr_valor, b.cmpr_data, c.fnc_nome, c.fnc_sobrenome, c.fnc_cpf, d.cl_nome, d.cl_sobrenome, d.cl_cpf FROM tb_venda AS a INNER JOIN tb_compra AS b ON a.id_compra = b.id_compra INNER JOIN tb_funcionario AS c ON a.fnc_matricula = c.fnc_matricula INNER JOIN tb_cliente AS d ON a.id_cliente = d.id_cliente;